import { Link } from "react-router-dom";
import { Toggle } from "../utils/context/toggleTheme";

const Header = () => {
  return (
    <header>
      <NightModeButton />
      <nav>
        <Link to="/">Home</Link>
        <Link to="freelances">Freelances</Link>
        <Link to="/survey/1">Survey</Link>
      </nav>
    </header>
  );
};

export default Header;
